    const checkKey = async () => {
      try {
          const aistudio = (window as any).aistudio;
          const hasKey = !!process.env.API_KEY || (aistudio?.hasSelectedApiKey ? await aistudio.hasSelectedApiKey() : false);
          setIsAuthorized(hasKey);
      } catch (e) {
          console.error("Auth check failed", e);
      } finally {
          setCheckingAuth(false);
      }
    };
    checkKey();
  }, []);

  // Persist history to localStorage
  useEffect(() => {
    const saved = localStorage.getItem('orion_history');
    if (saved) {
      try {
        setHistory(JSON.parse(saved));
      } catch (e) { console.error("History parse failed"); }
    }
  }, []);

  useEffect(() => {
    localStorage.setItem('orion_history', JSON.stringify(history));
  }, [history]);

  const handleOpenKeyPicker = async () => {
      setActivatingLink(true);
      setError(null);
      const aistudio = (window as any).aistudio;

      try {
          if (aistudio?.openSelectKey) {
              await aistudio.openSelectKey();
              // Guideline: Assume the key selection was successful after triggering openSelectKey
              setIsAuthorized(true);
              setError(null);
          } else {
              if (!process.env.API_KEY) {
                  throw new Error("INTERFACE ERROR|Neural Link failed. API_KEY required in environment or AI Studio session.");
              } else {
                  setIsAuthorized(true);
              }
          }
      } catch (e) {
          setError(e instanceof Error ? e.message : "LINK ERROR|Connection protocol failed.");
      } finally {
          setActivatingLink(false);
      }
  };

  const addToHistory = (result: PromptAnalysis) => {
    const newItem: HistoryItem = {
      id: Date.now().toString(),
      timestamp: Date.now(),
      originalPreview: result.originalText.substring(0, 40) + (result.originalText.length > 40 ? '...' : ''),
      optimizedPreview: result.optimizedPrompt.substring(0, 40) + (result.optimizedPrompt.length > 40 ? '...' : ''),
      score: result.score,
      fullAnalysis: result
    };
    setHistory(prev => [newItem, ...prev].slice(0, 20));
  };

  const handleOptimize = async () => {
    if (!inputPrompt.trim()) return;
    setLoading(true);
    setError(null);
    try {
      const result = await optimizePrompt(inputPrompt, language);
      if (result) {
        setAnalysis(result);
        addToHistory(result);
      }
    } catch (err) {
      const errMsg = err instanceof Error ? err.message : "SYSTEM FAILURE|Optimization protocol failed.";
      setError(errMsg);

      // If auth fails, reset authorized state to prompt for key again
      if (errMsg.toLowerCase().includes("not found") || errMsg.toLowerCase().includes("api key") || errMsg.toLowerCase().includes("authentication failed")) {
          setIsAuthorized(false);
      }
    } finally {
      setLoading(false);
    }
  };

  const errorObj = parseError(error);
  const isAuthError = errorObj && (errorObj.title.includes("AUTH") || errorObj.title.includes("KEY") || errorObj.title.includes("CONFIGURATION") || errorObj.title.includes("NOT FOUND"));

  if (checkingAuth) {
      return (
          <div className="min-h-screen bg-[#050505] flex items-center justify-center font-mono-tech text-[#39ff14]">
              <div className="animate-pulse tracking-[0.2em]">INITIALIZING_NEURAL_LINK...</div>
          </div>
      );
  }

  if (!isAuthorized) {
      return (
          <div className="min-h-screen bg-[#050505] bg-grid-pattern flex items-center justify-center p-6">
              <div className="max-w-md w-full animate-fadeIn">
                  <CyberPanel title="ENCRYPTION_LOCK">
                      <div className="text-center py-6">
                          <div className="w-16 h-16 border-2 border-red-500 rounded-full flex items-center justify-center mx-auto mb-6 shadow-[0_0_15px_rgba(239,68,68,0.5)]">
                              <span className="text-red-500 font-bold text-3xl">!</span>
                          </div>
